  "syllabusSections": [
    {
      "@type": "Syllabus",
      "name": "Course Introduction",
      "description": "This is the first course in the Academic English: Writing specialization, which will help prepare you for studying in an American college or university. This first course will go over some of the basics of grammar and punctuation that you'll need to do good writing. It is not intended to review all aspects of English grammar, only the few topics chosen for this class. In this short module, to get started, introduce yourself and get to know the other learners a little bit. In the following lessons, you will watch video lectures, do readings, do practice exercises, and take quizzes. To pass the course, just pass all three quizzes. When you finish one activity, then go on to the next one. Enjoy the class!",
      "timeRequired": "PT1H20M25S"
    },
    {
      "@type": "Syllabus",
      "name": "Verb Tenses and Conjunctions",
      "description": "In this module, you will watch video lectures, do readings, do practice exercises, and take quizzes. You can re-watch the videos or redo the exercises as many times as you need to to help you understand the material. This module will help you review verb tenses and how to use them correctly. You probably already studied these in your other English classes, so this will just be a quick reminder. Then you'll begin learning about how to use conjunctions in your sentences. This will help you write different kinds of sentences and make your writing more interesting.",
      "timeRequired": "PT3H57M41S"
    },
    {
      "@type": "Syllabus",
      "name": "Compound and Complex Sentences",
      "description": "Now that you've learned about conjunctions, you're ready to learn about different types of sentences. In English, there are four types of sentences that you can use--and should use--to make your writing more interesting to read. In this module, you'll learn about two of the advanced sentence types.",
      "timeRequired": "PT6H7M17.95S"
    },
    {
      "@type": "Syllabus",
      "name": "More Commas, Parallel Structure, and Sentence Variety",
      "description": "In this module, you'll learn some other uses for commas. After studying this module, you'll know about 95% of the ways commas can be used. That means you'll be able to write confidently, knowing that you are using commas correctly and not just guessing. In addition to learning about commas, you'll learn about creating parallel structure and sentence variety. When you add these to your writing tools, your writing will be even more effective.",
      "timeRequired": "PT6H20.128S"
    }
  ],
